import React, { Component } from 'react';
import './Item.css';

export default class Item extends Component {
  render() {
    const { title, checked } = this.props;

    return (
      <li className="todo-list__list-item__item">
        <h6>{title}</h6>
        <input type="checkbox" checked={checked} />
      </li>
    )
  }
}

